releases/0/tender/description:
HM Prison and Probation Service (HMPPS) Psychology Services Group (PSG) and the national Crime Agency (NCA) have future requirements for delivery of a range of psychological services. 
 
HMPPS require suitably qualified and experienced Forensic Psychologists (or Clinical Psychologists with substantial experience in forensic settings) to provide risk assessments, determining an offender's risk to the public in the community and after release, and other stand-alone psychological assessments. Parole Board directed work is a key priority for PSG and there is a legal requirement to comply with directions by providing timely, professional, and clinically sound assessments. There is also a need to deliver a range of evidence led interventions to address offending behaviour. This can be through accredited Offending Behaviour Programmes and also through bespoke psychological interventions, matched to meet the diverse needs of the offender population. 

The following services have been initially identified as within scope of PSG's psychological services requirement:
 
Delivery of Parole Directed/GPP process Psychological Risk Assessments; 
Delivery of stand-alone Responsivity and Suitability Assessments;
Case File Reviews; 
Delivery of the Healthy Sex Programme (HSP);
Delivery of a bespoke interventions, and;
Supervision of directly employed psychology staff in the delivery of HSP and other interventions.

Some elements of CPD and training supervision may also be part of the consideration.

NCA require, within the context of national law enforcement and a population of vulnerable adults and their families in the community, and working to operational and personal security protocols supplied by the authority, experienced Registered Psychologists and/or experienced clinicians with appropriate professional qualifications, to  complete clinical or clinical/forensic psychological assessments & reports and to undertake psychological treatment for the purposes of managing mental health and psychological risks within an operational context. 

We would like to invite interested parties to a market engagement event followed by completion of a market analysis questionnaire, the purpose of which will be an opportunity for the market to gain a greater understanding of our future requirements and to help us to shape our requirements and inform any potential opportunities and areas of challenge. 

The event will be held on Wednesday 24th April 2024 between 1000 and 1200 and will be a remote/virtual event, delivered via Microsoft Teams. 

To register your interest and to receive further information on how to access the Market Engagement event, please email the MoJ Offender Welfare team email address - MoJProcurement.Off@justice.gov.uk 

Please register your interest by 1400 on Friday 19th April.

This engagement does not constitute a commitment to undertake any procurement exercise. Whilst HMPPS and NCA are approaching the market together, future activity may not be linked
